import React, { useState } from "react";
import MDEditor from "react-md-editor";

const RequestPostPage: React.FC = () => {
  const [body, setBody] = useState<string>("");

  return (
    <React.Fragment>
      <h1 className="post-form-heading">Ask a Question</h1>
      <form className="post-form-container">
        <input
          type="text"
          className="post-form-input"
          id="title"
          placeholder="Title"
          required
        />
        <MDEditor value={body} onChange={setBody} />
      </form>
    </React.Fragment>
  );
};

export default RequestPostPage;
